  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Zones are derived from a focal mean
  analysis on bathymetry and slope. The grid is based on gridded (5 m cell size) multibeam
  bathymetry, collected aboard R/V AHI, merged with seafloor depths derived from multispectral
  IKONOS satellite imagery. BPI Structures was was created using the Benthic Terrain
  Modeler (http://www.csc.noaa.gov/products/btm/). Cell values represent one of 4
  classes (crest, depression, flat, slope) in an index of seafloor terrains. This
  data set is for Ofu and Olosega Islands of the Manu'a Island group, American Samoa.\",\n\t\"license_title\":
